    false,nt"url": null,nt"notes": "This static map image portrays legislative
    district boundaries of district 28as of March 9, 2002. A Legislative district is
    a political subdivisions into which a state is divided for electing members to the
    Legislature. Each legislative district is represented by one senator and two representatives.
    Since Idaho's legislative districts are not further split into two House of Representative
    districts, both representatives, like the senator, serve the entire district. The
    districts are established by state law and are redrawn following a decennial census
    to maintain equal population in each.",nt"owner_org": "75e22a8a-da5f-46f3-93d8-924063a3703d",nt"extras":
